import React from "react";
import { Container, Jumbotron, Row, Col } from "react-bootstrap";

function Hero(props) {
  return (
    <Jumbotron>
      <Container>
        <Row>
          <Col>
            { propTypes.title && <h1> {props.title} </h1> }
          </Col>
        </Row>
      </Container>
    </Jumbotron>
  );
}

export default Hero;
